import {Fragment} from 'react'
const MealItem = props => 
{
    return(
        <Fragment>
            <div>
                <h1>{props.data.name}</h1>
                <p>{props.data.description}</p>
                <h2>{props.data.price}</h2>
            </div>
        </Fragment>
    );
}

export default MealItem;
